import time

""" 
給予一組整數陣列, 為non-decreasing排列
回傳一個整數陣列, 和輸入陣列有相同長度, 內容為該位置與其他位置的絕對差異值總和
(summation of absolute differences)
"""

class Solution:
    def getSumAbsoluteDifferences(self, nums: list[int]) -> list[int]:
        result = []
        for i in range(len(nums)):
            result.append(0)
            for j in range(len(nums)):
                if j < i:
                    result[i] += (nums[i]-nums[j])
                if j > i:
                    result[i] += (nums[j]-nums[i])
        return result
    
    def getSumAbsoluteDifferences2(self, nums: list[int]) -> list[int]:
        result = []
        total_sum = sum(nums)
        left_sum = 0
        
        for i in range(len(nums)):
            right_sum = total_sum - left_sum - nums[i]
            result.append((nums[i]*(i)-left_sum)+(right_sum-nums[i]*(len(nums)-i-1)))
            left_sum += nums[i]
        
        return result

